CONTRATAÇÃO DE EMPRESA OBJETIVANDO A PARTICIPAÇÃO DE 05 (CINCO) SERVIDORES DESTA SECRETARIA ESTADUAL DE SAÚDE DE RONDÔNIA NO 20º CONGRESSO BRASILEIRO DE GESTÃO, PROJETOS E LIDERANÇA REALIZADO PELO PROJECT MANAGEMENT INSTITUTE - PMI, QUE SERÁ REALIZADO PRESENCIALMENTE EM FORTALEZA/CE  NOS DIAS 22 E 23 DE ABRIL DE 2025.

DETALHES DO EVENTO:

Data: 22 e 23 de abril de 2025;

Local: Fábrica de Negócios (Av. Monsenhor Tabosa, 740 - Centro, Fortaleza - CE);

Conteúdo programático: Sistemas de Planejamento e de Orçamento; Expansão do Ciclo Orçamentário; Execução Orçamentária e Financeira; Plano Plurianual (PPA); Receita e Despesa Públicas; Lei De Diretrizes Orçamentárias (LDO); Consolidação das Propostas Setoriais e Tópicos Especiais de Aspectos Fiscais no Orçamento Público;

Saída prevista: 21/04/2025;

Retorno previsto: 23/04/2025.

A contratação de eventos especializados na área de Gestão e Liderança é estratégica para proporcionar aos servidores da Secretaria Estadual de Saúde a atualização contínua necessária, capacitando-os para o desenvolvimento mais eficaz de projetos e aprimoramento do planejamento no âmbito da saúde pública.

O CBGPL, promovido anualmente pelo Project Management Institute (PMI), é considerado o principal evento no Brasil voltado à gestão de projetos, reunindo gestores, líderes e especialistas renomados. Este congresso oferece uma oportunidade ímpar de aprendizado, capacitação e troca de experiências com profissionais de diversas áreas.

A participação dos servidores no congresso é crucial para o aprimoramento da gestão pública, especialmente na área da saúde.

